allParams.jsonSchema:
{
  "name" : "page",
  "in" : "query",
  "description" : "検索結果のうち、取得したいページの番号(1始まり）",
  "required" : false,
  "style" : "form",
  "explode" : true,
  "schema" : {
    "minimum" : 1,
    "type" : "integer",
    "default" : 1
  }
}

{
  "name" : "query",
  "in" : "query",
  "description" : "絞り込み条件。[AnnotationQuery](#/components/schemas/AnnotationQuery)** をURIエンコードしたもの。\n",
  "required" : false,
  "style" : "form",
  "explode" : true,
  "schema" : {
    "$ref" : "#/components/schemas/AnnotationQuery"
  }
}

{
  "name" : "sort",
  "in" : "query",
  "description" : "ソート順の指定。\n使用可能キーはtask_id, input_data_id, detail.annotation_id, detail.account_id, detail.label_id, detail.data_holding_type, detail.created_datetime, detail.updated_datetimeのいずれかです。降順指定時は先頭に-(ハイフン)を付与します。\n複数指定時は,(カンマ)区切りで列挙します。複数キーを列挙した場合は、先頭から優先順位を割り振られます。\n",
  "required" : false,
  "style" : "form",
  "explode" : true,
  "schema" : {
    "type" : "string"
  },
  "example" : "task_id,input_data_id,detail.annotation_id,-detail.updated_datetime"
}

